class App extends React.Component{
  state = {
    articles: []
  }

  componentDidMount(){
    let url = "'https://newsapi.org/v2/top-headlines?' + 'country=us&' + 'apiKey=f0a7beb8be6040cfadf7471e6a6676b4'"
  }
  render(){
    return(
      <div>
        <h1 style={{textAlign:"center", color: "green"}}>
          Welcome to Wander Times
        </h1>
        <NavContainer />
        <CategoryContainer />
        <ArticleContainer />
      </div>
    )
  }
}

export default App;
